    body::after {
      content: '';
      position: fixed;
      top: 0; left: 0; right: 0; bottom: 0;
      backdrop-filter: blur(14px);
      background: rgba(255,255,255,0.2);
      z-index: -1;
    }
    .form-box {
      height: 100dvh;
      max-height: 720px;
      overflow-y: auto;
      display: flex;
      flex-direction: column;
      justify-content: space-between;
      background: rgba(255, 255, 255, 0.92);
      padding: 20px 16px;
      border-radius: 24px;
      box-shadow: 0 18px 48px rgba(0, 0, 0, 0.2);
      width: 100%;
      max-width: 420px;
      text-align: center;
      z-index: 10;
    }
    .logo {
      width: 180px;
      margin-bottom: 4px;
      display: block;
      margin-left: auto;
      margin-right: auto;
    }
    h1 {
      font-size: 26px;
      color: #0f172a;
      margin-bottom: 8px;
    }
    input, select {
      width: 100%;
      padding: 16px 18px;
      margin-bottom: 18px;
      font-size: 15px;
      border: none;
      border-radius: 16px;
      background: #f8fafc;
      box-shadow: inset 0 2px 4px rgba(0, 0, 0, 0.08);
      transition: all 0.3s ease;
    }
    input:focus, select:focus {
      outline: none;
      background: #fff;
      box-shadow: 0 0 0 3px rgba(59, 130, 246, 0.25);
    }
    input::placeholder {
      color: #94a3b8;
    }
    button {
      width: 100%;
      padding: 16px;
      background: linear-gradient(145deg, #1e3a8a, #1e40af);
      color: white;
      font-weight: 700;
      font-size: 17px;
      border: none;
      border-radius: 18px;
      cursor: pointer;
      box-shadow: 0 4px 12px rgba(30, 64, 175, 0.3);
      transition: all 0.25s ease;
    }
    button:hover {
      box-shadow: 0 6px 16px rgba(30, 64, 175, 0.45);
      transform: translateY(-1px);
    }
    .note {
      font-size: 12px;
      color: #475569;
      margin-top: 12px;
    }
  </style>

<script>
function handleSubmit(e) {
  e.preventDefault();
  const modal = document.getElementById("successModal");
  modal.classList.remove("hidden");
  modal.classList.add("fade-in");
  setTimeout(() => {
    modal.classList.remove("fade-in");
  }, 2000);
}
</script>
<style>
#successModal {
  position: fixed;
  top: 40%;
  left: 50%;
  transform: translate(-50%, -50%);
  background: white;
  color: #1e293b;
  padding: 24px 32px;
  font-size: 16px;
  font-weight: bold;
  border-radius: 16px;
  box-shadow: 0 8px 24px rgba(0, 0, 0, 0.3);
  z-index: 999;
}
.fade-in {
  animation: fadeIn 0.5s ease forwards;
}
@keyframes fadeIn {
  from { opacity: 0; transform: translate(-50%, -60%); }
  to { opacity: 1; transform: translate(-50%, -50%); }
}
.hidden {
  display: none;
}
</style>
